import React from "react";
import i from "../../../assets/img/box1.jpg";
import ii from "../../../assets/img/box2.jpg";
import iii from "./y.png";
import iiii from "../../../../public/apple-icon.png";


export const Photos = [
  {
    source: { i },
    width: 4,
    height: 3,
  },
  {
    src: { ii },
    width: 4,
    height: 3,
  },
  {
    src: { iii },
    width: 4,
    height: 3,
  },
  {
    src:{iiii},
    width: 4,
    height: 3,
  },
  {
    src: { i },
    width: 4,
    height: 3,
  },
];
